import React from 'react'
import AsesorGeneral from './AsesorGeneral';
import { useHistory } from "react-router-dom";

const Asesor2 = () => {
    let History = useHistory();
  return (
    <div><AsesorGeneral onclick={()=> History.push("/Rasesor")}/></div>
  )
}

export default Asesor2
